import React from "react";
import logo from "./assets/IMG_0023.jpg";
import "./App.css";
import TopNavBar from "./components/navbar/navbar";
function App() {
  return (
    <>
      <div className="App">
        <header className="App-header">
          <img
            src={logo}
            className="App-logo justify-content-center"
            alt="logo"
          />
          <TopNavBar />
        </header>
      </div>
    </>
  );
}

export default App;
